import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { Container } from '@mui/material';

// Import your context providers
import { AuthProvider } from './context/authContext';
import { AlertProvider } from './context/alertContext';

// Import your pages and components
import Home from './pages/Home';
import Login from './pages/Login';
import Register from './pages/Register';
import Dashboard from './pages/Dashboard';
import NewOrder from './pages/NewOrder';
import NotFound from './pages/NotFound';
import AlertSnackbar from './components/AlertSnackbar'; // Your alert component
// import Navbar from './components/Navbar'; // Assuming you have a Navbar

export default function App() {
  return (
    // Wrap your entire app with the providers.
    // AlertProvider is first so Auth functions can trigger alerts.
    <AlertProvider>
      <AuthProvider>
        <Router>
          {/* <Navbar /> */}
          <AlertSnackbar />
          <Container component="main" sx={{ mt: 4, mb: 4 }}>
            <Routes>
              <Route path="/" element={<Home />} />
              <Route path="/login" element={<Login />} />
              <Route path="/register" element={<Register />} />
              <Route path="/dashboard" element={<Dashboard />} />
              <Route path="/order/new" element={<NewOrder />} />
              <Route path="*" element={<NotFound />} />
            </Routes>
          </Container>
        </Router>
      </AuthProvider>
    </AlertProvider>
  );
}
